import React from 'react'

function Restaurant({venues}) {
    const list = venues.map((venue, i) => {
        return (
            <div key={venue.id} className='panel'>
                <p>{i + 1}. {venue.name}</p>
                <p>Address: {venue.location.address}</p>
            </div>
        )
    })
    
    return (
        <div>
            {list}
        </div>
    )
}

export default Restaurant
